      <Grid item xs={7}>
        <Typography variant="h2">Loaloa.me</Typography>
        <Typography variant="h3">Cung cấp các giải pháp công nghệ.</Typography>
        <Typography variant="h1">Xin Chào,</Typography>
      </Grid>
      <Grid item xs={5}>
        <img style={{ width: "100%" }} src="/img/banner.png" />
      </Grid>
    </Grid>
  );
}
